import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public timeLogs?: TimeLog[];

  constructor(http: HttpClient) {
    http.get<TimeLog[]>('https://localhost:44303/api/TimeLog').subscribe(result => {
      this.timeLogs = result;
    }, error => console.error(error));
  }
  title = 'Timely';
}

interface TimeLog {
  id: number;
  projectName: string;
  startDate: string;
  endDate: string;
  duration: string;
}
<h1 id="tableLabel">Timely</h1>

<p *ngIf="!timeLogs"><em>Loading...</em></p>

<button class="btn btn-primary">Start</button>

<table ngClass="table table-striped" *ngIf="timeLogs">
    <thead>
        <tr>
            <th>Project Name</th>
            <th>Start Date</th>
            <th>End Date</th>
            <th>Duration</th>
        </tr>
    </thead>
    <tbody>
        <tr *ngFor="let timeLog of timeLogs">
            <td>{{ timeLog.projectName }}</td>
            <td>{{ timeLog.startDate }}</td>
            <td>{{ timeLog.endDate }}</td>
            <td>{{ timeLog.duration }}</td>
        </tr>
    </tbody>
</table>
